import React, {Component} from 'react';
import {Button, Col, Container, Form, Modal, Row, Badge} from 'react-bootstrap';
import {Figure, Image, Accordion, Card} from 'react-bootstrap';
import {DrawCOCOimage} from './drawCOCOimage';
import {getRandomCocoExample} from './cocoParser';

import {ClassesCOCO} from './classesCOCO';

export function COCO () {

	const [randomCOCOimage, setRandomCOCOimage] = React.useState({Image: getRandomCocoExample()});
	const [random, setRandom] = React.useState({state: true});
	function changeImage(){
		setRandomCOCOimage({Image: getRandomCocoExample()});
	}
	function showbboxes(){
		if(random.state){
			console.log(random.state);
			const tempRandomState = randomCOCOimage;
			tempRandomState.Image.showBboxes = true;
			setRandomCOCOimage(tempRandomState);
		}
	}

	return(

		<Container>
			<Row>
				<Col xs={12} md={8}>
					<div>
						<Form>
							<Form.Check style={{float:'left', marginLeft: '.5rem'}}
								//checked
								onChange={()=>showbboxes()}
								type="switch"
								id="bboxes"
								label="Show bounding boxes"
							/>
							<Form.Check style={{float:'left', marginLeft: '.5rem'}}
								type="switch"
								id="keypoints"
								label="Show keypoints"
							/>
						</Form>
					</div>
					<Figure onClick={()=>changeImage()}>
						<DrawCOCOimage props={randomCOCOimage}/>
						<Figure.Caption>
							Created sample
						</Figure.Caption>
					</Figure>

				</Col>
				<Col xs={6} md={4}>

					<ClassesCOCO></ClassesCOCO>

				</Col>
			</Row>

			<Row>
				<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
				</Col>
				<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
				</Col>
				<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
				</Col>
			</Row>
		</Container>
	);


}
